Andamos en busca de un jg para completar la  escuadra llamada&quot; I Choose Evolution &quot; 
Requisitos: Usar Discord - Elo Platino en flex minimo 
Nos se busca al mejor sino al que quiera progresar :D , se va a ir capacitando al jugador mejor en su linea si no tiene experiencia en equipos, El horario de entrenamiento como torneos se arreglara entre todos , Cualquier consulta agregar a : SFG Baggy o a mi. Si hoy conseguimos jg estaremos para practicar en scrim contra las otras escuadras.
